import {
  Nav,
  Navbar,
  Form,
  FormControl,
  Container,
  NavDropdown,
  Button,
} from "react-bootstrap";
import { useState, useContext } from "react";
import { ModeContext } from "./ModeContext";
import { Arabic } from "./Language";
import { English } from "./Language";
function Header() {
  const value = useContext(ModeContext);
  const [show, setShow, language, setLanguage] = useContext(ModeContext);
  //const [language, setLanguage]= useContext(LanguageContext);
  function ChangeLnaguage(x) {
    setLanguage(x);
  }
  function handleShow() {
    setShow(true);
  }

  return (
    <div className="header">
      <Navbar collapseOnSelect expand="lg" bg="light" variant="light">
        <Container>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#services">SHOPE</Nav.Link>
              <Nav.Link href="#about">OUR STORY</Nav.Link>
              <Nav.Link href="#contact">EXPERTISE</Nav.Link>
            </Nav>

            <img src="./assets/img/logo.svg" />
            <Nav>
              <label>CONTACT</label>
              <div style={{ marginLeft: "100px" }}>
                <img
                  style={{ marginLeft: "10px" }}
                  src="./assets/icons/search.svg"
                />
                <img
                  style={{ marginLeft: "10px" }}
                  src="./assets/icons/person.svg"
                />
                <img
                  style={{ marginLeft: "10px" }}
                  src="./assets/icons/cart3.svg"
                />
              </div>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Header;
